  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	last_modified_on: '2020-07-13',
	title: 'Unit Tests',
	description: 'Vector\'s unit test configuration options, allowing you to unit test your Vector configuration files.',
	status: 'beta'
};
export const metadata = {
  "id": "reference/tests",
  "title": "Unit Tests",
  "description": "Vector's unit test configuration options, allowing you to unit test your Vector configuration files.",
  "source": "@site/docs/reference/tests.md",
  "permalink": "/docs/reference/tests",
  "editUrl": "https://github.com/timberio/vector/edit/master/website/docs/reference/tests.md",
  "sidebar": "docs",
  "previous": {
    "title": "Templating",
    "permalink": "/docs/reference/templating"
  },
  "next": {
    "title": "Administration",
    "permalink": "/docs/administration"
  }
};
  /* @jsx mdx */
import Fields from '@site/src/components/Fields';
import Field from '@site/src/components/Field';
import Tabs from '@theme/Tabs';
import TabItem from '@theme/TabItem';
export const rightToc = [{
  value: 'Configuration',
  id: 'configuration',
  children: [{
    value: 'inputs',
    id: 'inputs',
    children: []
  }, {
    value: 'name',
    id: 'name-1',
    children: []
  }, {
    value: 'no_outputs_from',
    id: 'no_outputs_from',
    children: []
  }, {
    value: 'outputs',
    id: 'outputs',
    children: []
  }]
}];
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`It's possible to define unit tests within a Vector configuration file that cover
a network of transforms within the topology. The intention of these tests is to
improve the maintainability of configs containing larger and more complex
combinations of transforms.`}</p>
    <p>{`Executing tests within a config file can be done with the `}<inlineCode parentName="p">{`test`}</inlineCode>{` subcommand:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`vector test /etc/vector/*.toml
`}</code></pre>
    {
      /*
          THIS FILE IS AUTOGENERATED!
           To make changes please edit the template located at:
           website/docs/reference/tests.md.erb
      */
    }
    <h2 {...{
      "id": "configuration"
    }}>{`Configuration`}</h2>
    <Tabs block={true} defaultValue="common" values={[{
      label: 'Common',
      value: 'common'
    }, {
      label: 'Advanced',
      value: 'advanced'
    }]} mdxType="Tabs">
      <TabItem value="common" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[transforms.foo]
  type = "regex_parser"
  regex = "^(?P<timestamp>[\\\\w\\\\-:\\\\+]+) (?P<level>\\\\w+) (?P<message>.*)$"

[[tests]]
  # Inputs
  [[tests.inputs]]
    insert_at = "foo" # required
    type = "raw" # required
    value = "some message contents" # required, required when type = "raw"

  # General
  name = "foo test" # required

  # Outputs
  [[tests.outputs]]
    # Conditions
    conditions.type = "check_fields" # optional, default
    conditions."message.eq" = "this is the content to match against" # example
    conditions."message.eq" = ["match this", "or this"] # example
    conditions."message.contains" = "foo" # example
    conditions."message.contains" = ["foo", "bar"] # example
    conditions."environment.ends_with" = "-staging" # example
    conditions."environment.ends_with" = ["-staging", "-running"] # example
    conditions."message.regex" = " (any|of|these|five|words) " # example
    conditions."environment.starts_with" = "staging-" # example
    conditions."environment.starts_with" = ["staging-", "running-"] # example

    # General
    extract_from = "foo" # required
`}</code></pre>
      </TabItem>
      <TabItem value="advanced" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[transforms.foo]
  type = "regex_parser"
  regex = "^(?P<timestamp>[\\\\w\\\\-:\\\\+]+) (?P<level>\\\\w+) (?P<message>.*)$"

[[tests]]
  # Inputs
  [[tests.inputs]]
    # General
    insert_at = "foo" # required
    type = "raw" # required
    value = "some message contents" # required, required when type = "raw"

    # Log fields
    log_fields.message = "some message contents" # example
    log_fields.host = "myhost" # example

    # Metric
    # General
    metric.direction = "plus" # optional, no default
    metric.name = "duration_total" # required
    metric.sample_rate = 1 # optional, no default
    metric.timestamp = "2019-11-01T21:15:47.443232Z" # required
    metric.type = "counter" # required
    metric.val = 10.2 # required

    # Tags
    metric.tags.host = "foohost" # example
    metric.tags.region = "us-east-1" # example

  # General
  name = "foo test" # required
  no_outputs_from = ["foo"] # required

  # Outputs
  [[tests.outputs]]
    # Conditions
    conditions.type = "check_fields" # optional, default
    conditions."message.eq" = "this is the content to match against" # example
    conditions."message.eq" = ["match this", "or this"] # example
    conditions."host.exists" = true # example
    conditions."method.neq" = "POST" # example
    conditions."method.neq" = ["POST", "GET"] # example
    conditions."message.not_contains" = "some phrase to ignore" # example
    conditions."unit.not_starts_with" = "sys-" # example
    conditions."unit.not_ends_with" = ".device" # example
    conditions."message.contains" = "foo" # example
    conditions."message.contains" = ["foo", "bar"] # example
    conditions."environment.ends_with" = "-staging" # example
    conditions."environment.ends_with" = ["-staging", "-running"] # example
    conditions."message.ip_cidr_contains" = "10.0.0.0/8" # example
    conditions."message.ip_cidr_contains" = ["2000::/10", "192.168.0.0/16"] # example
    conditions."message.regex" = " (any|of|these|five|words) " # example
    conditions."environment.starts_with" = "staging-" # example
    conditions."environment.starts_with" = ["staging-", "running-"] # example

    # General
    extract_from = "foo" # required
`}</code></pre>
      </TabItem>
    </Tabs>
    <p>{`For more information about unit tests check out `}<a parentName="p" {...{
        "href": "/guides/advanced/unit-testing/"
      }}>{`this guide`}</a>{`.`}</p>
    <Fields filters={true} mdxType="Fields">
      <Field common={true} defaultValue={null} enumValues={null} examples={[]} groups={[]} name={"inputs"} path={null} relevantWhen={null} required={true} templateable={false} type={"[table]"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "inputs"
        }}>{`inputs`}</h3>
        <p>{`A table that defines a unit test input event.`}</p>
        <Fields filters={false} mdxType="Fields">
          <Field common={true} defaultValue={null} enumValues={null} examples={["foo"]} groups={[]} name={"insert_at"} path={"inputs"} relevantWhen={null} required={true} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "insert_at"
            }}>{`insert_at`}</h4>
            <p>{`The name of a transform, the input event will be delivered to this transform in
order to begin the test.`}</p>
          </Field>
          <Field common={false} defaultValue={null} enumValues={null} examples={[]} groups={[]} name={"log_fields"} path={"inputs"} relevantWhen={{
            "type": "log"
          }} required={true} templateable={false} type={"table"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "log_fields"
            }}>{`log_fields`}</h4>
            <p>{`Specifies the log fields when the input type is 'log'.`}</p>
            <Fields filters={false} mdxType="Fields">
              <Field common={true} defaultValue={null} enumValues={null} examples={[{
                "message": "some message contents"
              }, {
                "host": "myhost"
              }]} groups={[]} name={"`[field-name]`"} path={"inputs.log_fields"} relevantWhen={null} required={true} templateable={false} type={"*"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "field-name"
                }}><inlineCode parentName="h5">{`[field-name]`}</inlineCode></h5>
                <p>{`A key/value pair representing a field to be added to the input event.`}</p>
              </Field>
            </Fields>
          </Field>
          <Field common={false} defaultValue={null} enumValues={null} examples={[]} groups={[]} name={"metric"} path={"inputs"} relevantWhen={{
            "type": "metric"
          }} required={true} templateable={false} type={"table"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "metric"
            }}>{`metric`}</h4>
            <p>{`Specifies the metric type when the input type is 'metric'.`}</p>
            <Fields filters={false} mdxType="Fields">
              <Field common={false} defaultValue={null} enumValues={{
                "plus": "Increase the gauge",
                "minus": "Decrease the gauge"
              }} examples={["plus", "minus"]} groups={[]} name={"direction"} path={"inputs.metric"} relevantWhen={null} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "direction"
                }}>{`direction`}</h5>
                <p>{`The direction to increase or decrease the gauge value.`}</p>
              </Field>
              <Field common={true} defaultValue={null} enumValues={null} examples={["duration_total"]} groups={[]} name={"name"} path={"inputs.metric"} relevantWhen={null} required={true} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "name"
                }}>{`name`}</h5>
                <p>{`The name of the metric. Defaults to `}<inlineCode parentName="p">{`<field>_total`}</inlineCode>{` for `}<inlineCode parentName="p">{`counter`}</inlineCode>{` and `}<inlineCode parentName="p">{`<field>`}</inlineCode>{`
for `}<inlineCode parentName="p">{`gauge`}</inlineCode>{`.`}</p>
              </Field>
              <Field common={false} defaultValue={null} enumValues={null} examples={[1]} groups={[]} name={"sample_rate"} path={"inputs.metric"} relevantWhen={null} required={false} templateable={false} type={"float"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "sample_rate"
                }}>{`sample_rate`}</h5>
                <p>{`The bucket/distribution the metric is a part of.`}</p>
              </Field>
              <Field common={true} defaultValue={null} enumValues={null} examples={[]} groups={[]} name={"tags"} path={"inputs.metric"} relevantWhen={null} required={false} templateable={false} type={"table"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "tags"
                }}>{`tags`}</h5>
                <p>{`Key/value pairs representing `}<a parentName="p" {...{
                    "href": "/docs/about/data-model/metric/#tags"
                  }}>{`metric tags`}</a>{`.`}</p>
                <Fields filters={false} mdxType="Fields">
                  <Field common={true} defaultValue={null} enumValues={null} examples={[{
                    "host": "foohost"
                  }, {
                    "region": "us-east-1"
                  }]} groups={[]} name={"`[tag-name]`"} path={"inputs.metric.tags"} relevantWhen={null} required={true} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
                    <h6 {...{
                      "id": "tag-name"
                    }}><inlineCode parentName="h6">{`[tag-name]`}</inlineCode></h6>
                    <p>{`Key/value pairs representing `}<a parentName="p" {...{
                        "href": "/docs/about/data-model/metric/#tags"
                      }}>{`metric tags`}</a>{`.`}</p>
                  </Field>
                </Fields>
              </Field>
              <Field common={true} defaultValue={null} enumValues={null} examples={["2019-11-01T21:15:47.443232Z"]} groups={[]} name={"timestamp"} path={"inputs.metric"} relevantWhen={null} required={true} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "timestamp"
                }}>{`timestamp`}</h5>
                <p>{`Time metric was created/ingested.`}</p>
              </Field>
              <Field common={true} defaultValue={null} enumValues={{
                "counter": "A [counter metric type][docs.data-model.metric#counter].",
                "gauge": "A [gauge metric type][docs.data-model.metric#gauge].",
                "histogram": "A [distribution metric type][docs.data-model.metric#distribution].",
                "set": "A [set metric type][docs.data-model.metric#set]."
              }} examples={["counter", "gauge", "histogram", "set"]} groups={[]} name={"type"} path={"inputs.metric"} relevantWhen={null} required={true} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "type"
                }}>{`type`}</h5>
                <p>{`The metric type.`}</p>
              </Field>
              <Field common={true} defaultValue={null} enumValues={null} examples={[10.2]} groups={[]} name={"val"} path={"inputs.metric"} relevantWhen={null} required={true} templateable={false} type={"float"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "val"
                }}>{`val`}</h5>
                <p>{`Amount to increment/decrement or gauge.`}</p>
              </Field>
            </Fields>
          </Field>
          <Field common={true} defaultValue={null} enumValues={{
            "raw": "Creates a log event where the message contents are specified in the field 'value'.",
            "log": "Creates a log event where log fields are specified in the table 'log_fields'.",
            "metric": "Creates a metric event, where its type and fields are specified in the table 'metric'."
          }} examples={["raw", "log", "metric"]} groups={[]} name={"type"} path={"inputs"} relevantWhen={null} required={true} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "type-1"
            }}>{`type`}</h4>
            <p>{`The event type.`}</p>
          </Field>
          <Field common={true} defaultValue={null} enumValues={null} examples={["some message contents"]} groups={[]} name={"value"} path={"inputs"} relevantWhen={{
            "type": "raw"
          }} required={true} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "value"
            }}>{`value`}</h4>
            <p>{`Specifies the log message field contents when the input type is 'raw'.`}</p>
          </Field>
        </Fields>
      </Field>
      <Field common={true} defaultValue={null} enumValues={null} examples={["foo test"]} groups={[]} name={"name"} path={null} relevantWhen={null} required={true} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "name-1"
        }}>{`name`}</h3>
        <p>{`A unique identifier for this test.`}</p>
      </Field>
      <Field common={false} defaultValue={null} enumValues={null} examples={[["foo"]]} groups={[]} name={"no_outputs_from"} path={null} relevantWhen={null} required={true} templateable={false} type={"[string]"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "no_outputs_from"
        }}>{`no_outputs_from`}</h3>
        <p>{`A list of transforms that must NOT output events in order for the test to pass.`}</p>
      </Field>
      <Field common={true} defaultValue={null} enumValues={null} examples={[]} groups={[]} name={"outputs"} path={null} relevantWhen={null} required={true} templateable={false} type={"[table]"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "outputs"
        }}>{`outputs`}</h3>
        <p>{`A table that defines a unit test expected output.`}</p>
        <Fields filters={false} mdxType="Fields">
          <Field common={true} defaultValue={null} enumValues={null} examples={[]} groups={[]} name={"conditions"} path={"outputs"} relevantWhen={null} required={false} templateable={false} type={"[table]"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "conditions"
            }}>{`conditions`}</h4>
            <p>{`A table that defines a collection of conditions to check against the output of
a transform. A test is considered to have passed when each condition has
resolved true for one or more events extracted from the target transform.An
expected output without conditions instead prints the input and output of a
target without checking its values.`}</p>
            <Fields filters={false} mdxType="Fields">
              <Field common={true} defaultValue={"check_fields"} enumValues={{
                "check_fields": "Allows you to check individual fields against a list of conditions.",
                "is_log": "Returns true if the event is a log.",
                "is_metric": "Returns true if the event is a metric."
              }} examples={["check_fields", "is_log", "is_metric"]} groups={[]} name={"type"} path={"outputs.conditions"} relevantWhen={null} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "type-2"
                }}>{`type`}</h5>
                <p>{`The type of the condition to execute.`}</p>
              </Field>
              <Field common={true} defaultValue={null} enumValues={null} examples={[{
                "message.eq": "this is the content to match against"
              }, {
                "message.eq": ["match this", "or this"]
              }]} groups={[]} name={"`[field-name]`.eq"} path={"outputs.conditions"} relevantWhen={{
                "type": "check_fields"
              }} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "field-nameeq"
                }}><inlineCode parentName="h5">{`[field-name]`}</inlineCode>{`.eq`}</h5>
                <p>{`Check whether a fields contents exactly matches the value specified. This may
be a single string or a list of strings, in which case this evaluates to true
if any of the list matches.`}</p>
              </Field>
              <Field common={false} defaultValue={null} enumValues={null} examples={[{
                "host.exists": true
              }]} groups={[]} name={"`[field-name]`.exists"} path={"outputs.conditions"} relevantWhen={{
                "type": "check_fields"
              }} required={false} templateable={false} type={"bool"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "field-nameexists"
                }}><inlineCode parentName="h5">{`[field-name]`}</inlineCode>{`.exists`}</h5>
                <p>{`Check whether a field exists or does not exist, depending on the provided value
being `}<inlineCode parentName="p">{`true`}</inlineCode>{` or `}<inlineCode parentName="p">{`false`}</inlineCode>{` respectively.`}</p>
              </Field>
              <Field common={false} defaultValue={null} enumValues={null} examples={[{
                "method.neq": "POST"
              }, {
                "method.neq": ["POST", "GET"]
              }]} groups={[]} name={"`[field-name]`.neq"} path={"outputs.conditions"} relevantWhen={{
                "type": "check_fields"
              }} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "field-nameneq"
                }}><inlineCode parentName="h5">{`[field-name]`}</inlineCode>{`.neq`}</h5>
                <p>{`Check whether a fields contents does not match the value specified. This may be
a single string or a list of strings, in which case this evaluates to false if
any of the list matches.`}</p>
              </Field>
              <Field common={false} defaultValue={null} enumValues={null} examples={[{
                "message.not_contains": "some phrase to ignore"
              }, {
                "unit.not_starts_with": "sys-"
              }, {
                "unit.not_ends_with": ".device"
              }]} groups={[]} name={"`[field-name]`.not_`[condition]`"} path={"outputs.conditions"} relevantWhen={{
                "type": "check_fields"
              }} required={false} templateable={false} type={"any"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "field-namenot_condition"
                }}><inlineCode parentName="h5">{`[field-name]`}</inlineCode>{`.not_`}<inlineCode parentName="h5">{`[condition]`}</inlineCode></h5>
                <p>{`Check if the given `}<inlineCode parentName="p">{`[condition]`}</inlineCode>{` does not match.`}</p>
              </Field>
              <Field common={true} defaultValue={null} enumValues={null} examples={[{
                "message.contains": "foo"
              }, {
                "message.contains": ["foo", "bar"]
              }]} groups={[]} name={"`[field_name]`.contains"} path={"outputs.conditions"} relevantWhen={{
                "type": "check_fields"
              }} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "field_namecontains"
                }}><inlineCode parentName="h5">{`[field_name]`}</inlineCode>{`.contains`}</h5>
                <p>{`Checks whether a string field contains a string argument. This may be a single
string or a list of strings, in which case this evaluates to true if any of the
list matches.`}</p>
              </Field>
              <Field common={true} defaultValue={null} enumValues={null} examples={[{
                "environment.ends_with": "-staging"
              }, {
                "environment.ends_with": ["-staging", "-running"]
              }]} groups={[]} name={"`[field_name]`.ends_with"} path={"outputs.conditions"} relevantWhen={{
                "type": "check_fields"
              }} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "field_nameends_with"
                }}><inlineCode parentName="h5">{`[field_name]`}</inlineCode>{`.ends_with`}</h5>
                <p>{`Checks whether a string field ends with a string argument. This may be a single
string or a list of strings, in which case this evaluates to true if any of the
list matches.`}</p>
              </Field>
              <Field common={false} defaultValue={null} enumValues={null} examples={[{
                "message.ip_cidr_contains": "10.0.0.0/8"
              }, {
                "message.ip_cidr_contains": ["2000::/10", "192.168.0.0/16"]
              }]} groups={[]} name={"`[field_name]`.ip_cidr_contains"} path={"outputs.conditions"} relevantWhen={{
                "type": "check_fields"
              }} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "field_nameip_cidr_contains"
                }}><inlineCode parentName="h5">{`[field_name]`}</inlineCode>{`.ip_cidr_contains`}</h5>
                <p>{`Checks whether an IP field is contained within a given `}<a parentName="p" {...{
                    "href": "https://en.wikipedia.org/wiki/Classless_Inter-Domain_Routing"
                  }}>{`IP CIDR`}</a>{`
(works with IPv4 and IPv6). This may be a single string or a list of strings,
in which case this evaluates to true if the IP field is contained within any of
the CIDRs in the list.`}</p>
              </Field>
              <Field common={true} defaultValue={null} enumValues={null} examples={[{
                "message.regex": " (any|of|these|five|words) "
              }]} groups={[]} name={"`[field_name]`.regex"} path={"outputs.conditions"} relevantWhen={{
                "type": "check_fields"
              }} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "field_nameregex"
                }}><inlineCode parentName="h5">{`[field_name]`}</inlineCode>{`.regex`}</h5>
                <p>{`Checks whether a string field matches a `}<a parentName="p" {...{
                    "href": "https://en.wikipedia.org/wiki/Regular_expression"
                  }}>{`regular expression`}</a>{`.
Vector uses the `}<a parentName="p" {...{
                    "href": "https://docs.rs/regex/1.3.6/regex/#syntax"
                  }}>{`documented Rust Regex syntax`}</a>{`. Note
that this condition is considerably more expensive than a regular string match
(such as `}<inlineCode parentName="p">{`starts_with`}</inlineCode>{` or `}<inlineCode parentName="p">{`contains`}</inlineCode>{`) so the use of those conditions are
preferred where possible.`}</p>
              </Field>
              <Field common={true} defaultValue={null} enumValues={null} examples={[{
                "environment.starts_with": "staging-"
              }, {
                "environment.starts_with": ["staging-", "running-"]
              }]} groups={[]} name={"`[field_name]`.starts_with"} path={"outputs.conditions"} relevantWhen={{
                "type": "check_fields"
              }} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
